import {Button} from 'react-bootstrap'

export default function AccomCard(props) {
    return (
        <div>
            {props.event.accommodations.map(accommodation => accommodation.location)} <br/>
            {props.event.accommodations.map(accommodation => accommodation.date)} <br/>
            {console.log(props.event.id)}
            <Button> + </Button>
        </div>
    )
}
